" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    Elevated left ventricular end-diastolic pressure causes pulmonary congestion",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 498px; height: 248px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The heart is seen in diastole when the mitral valve is open and the left ventricle (LV), left atrium (LA), and pulmonary veins forms a common chamber, continuous with the pulmonary capillary bed. The LV end diastolic pressure determines the pulmonary capilalry pressure and the presence or absence of pulmonary congestion or edema.",
