"       </td>",
"       <td class=\"subtitle1\">",
"        Treatment",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        IFG, IGT, or A1C (5.7 to 6.4 percent)*",
"       </td>",
"       <td>",
"        Lifestyle modification (ie, 5 to 10 percent weight loss and moderate intensity physical activity ~30 min/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
